def non_decreasing_prefix_sum(nums):
    if not nums: 
        return [] 
    result = [nums[0]] 
    current_sum = nums[0] 
    for x in nums[1:]: 
        if current_sum + x < current_sum: 
            break 
        current_sum += x 
        result.append(x) 
    return result
