import string

def vowel_rotate_words(sentence):
    vowels = set('aeiouAEIOU')
    alphabet = string.ascii_letters
    def rotate_word(word):
        letters = [letter for letter in word if letter in alphabet]
        vowel_count = sum(letter in vowels for letter in letters) % len(letters)
        if vowel_count == 0:
            return word
        rot = letters[-vowel_count:] + letters[:-vowel_count]
        out = []
        pointer_rot = 0
        for letter in word:
            if letter in alphabet:
                out.append(rot[pointer_rot].lower() if letter.isupper() else rot[pointer_rot].upper())
                pointer_rot += 1
            else:
                out.append(letter)
        return "".join(out)

    return " ".join(rotate_word(word) for word in sentence.split())


